Rules.InvariantScript:
Set(
    gblResetComponents,
    true
);
Set(
    gblResetComponents,
    false
)

If(
    !gblComponentGalVisibility,
    //DropDown Icon Functionality
    Set(
        gblComponentGalVisibility,
        true
    );
    SetFocus(txtTextInputDD);
    Select(txtTextInputDD);
    ,
    //Close Icon Functionality
    If(
        IsBlank(gblDropDownSelected),
        If(
            IsBlank(txtTextInputDD.Text),
            Reset(DropDownComponent);
            SetFocus(btnFocusDD),
            Reset(txtTextInputDD);
            SetFocus(txtTextInputDD)
        ),
        Set(
            gblDropDownSelected,
            Blank()
        );
        Reset(txtTextInputDD);
        SetFocus(txtTextInputDD)
    )
)

Set(
    gblComponentGalVisibility,
    true
);
If(
    IsEmpty(colDropdownValue),
    ClearCollect(
        colDropdownValue,
        DropDownComponent.Items
    )
);
Select(rctResetDD);

Set(
    gblDropDownSelected,
    ThisItem.Value
);
Set(
    gblComponentGalVisibility,
    false
);
Reset(txtTextInputDD);
Set(gblSetFocus, true);
Set(gblSetFocus, false);
Set(
    gblTabIndex,
    0
);
SetFocus(imgCloseDD)

Not(
    ThisItem.Value = Last(
        Search(
            colDropdownValue,
            txtTextInputDD.Text,
            "Value"
        )
    ).Value
)

Set(
    gblComponentGalVisibility,
    false
);
Set(
    gblTabIndex,
    0
);
Reset(txtTextInputDD);
If(
    Self.Clear,
    Set(
        gblDropDownSelected,
        Blank()
    )
)
